(50, 'zNLfP-hB4xg', 'UCC552Sd-3nyi_tk2BudLUzA', 'Testing Hangover Cures ft. Mamrie Hart | The LAB', 'Can we prevent a hangover using science?\nWatch our video with Mamrie Hart here: https://youtu.be/Hz7ajUjLTzQ\nFollow us @mitchellmoffit & @WhaleWatchMePlz\n\nSUBSCRIBE: http://bit.ly/asapsci\n\nThe LAB is our series where we take your questions and turn them into experiments! Is there something you want us to try next? Let us know in the comments or on Instagram and Twitter. Who knows, your idea may become our next episode!\n\nAsapINSTAGRAM: https://instagram.com/asapscience/\nFacebook: http://facebook.com/AsapSCIENCE\nTwitter: http://twitter.com/AsapSCIENCE\nTumblr: http://asapscience.tumblr.com\n\nGET THE ASAPSCIENCE BOOK: http://asapscience.com/book/\n\nSend us stuff!\nASAPSCIENCE INC. \nP.O. Box 93 Toronto P, \nToronto, ON, M5S2S6\n\nProduced by: Gregory Brown, Mitchell Moffit, Rachel Salt\n\nEdited by: Sel Ghebrehiwot', '2017-02-20T18:15:47.000Z', 'https://i.ytimg.com/vi/zNLfP-hB4xg/mqdefault.jpg', 28),
